def skew_graph(string):
    result=[]
    result_index=[]
    position=[]
    score=0
    result.append(score)
    for i in range(len(string)):
        if string[i]=="G":
            score=result[-1]
            score+=1
            result.append(score)
            result_index.append((score,i))
        elif string[i]=="C":
            score=result[-1]
            score-=1
            result.append(score)
            result_index.append((score,i))

            
    min_score=min(result)
    for elem in result_index:
        if elem[0]==min_score:
            position.append(elem[1]+1)
        
    
    
    return position
    
    
Text=""
position=skew_graph(Text)
print (position)

